import React, { Component } from "react";
import ReactTypingEffect from "react-typing-effect";

const typingEffect = txt => {
  return (
    <div>
      <ReactTypingEffect text={txt} />
    </div>
  );
};

export default class IntroText1 extends Component {
  render() {
    console.log("yahooo", this.props.text);
    return (
      <div className="intro">
        <audio src="./../music/Suspense.mp3">
          <p>
            If you are reading this, it is because your browser does not support
            the audio element.{" "}
          </p>
        </audio>
        <div className="textIntro">YO{typingEffect(this.props.text)}</div>
      </div>
    );
  }
}
